response.activities:
Формы оказания услуг: 
• Разработка  дизайна интерьеров в этнотематике, непосредственное оформление заказа; 
• Выполнение на заказ этно сувениров из традиционных и современных материалов: меха, кожи, бересты, дерева, батика;
• Изготовление современной одежды и обуви с этно элементами (шарфы, кеды, и т.п.);
• Роспись посуды и керамических изделий; 
• Роспись занавесов и картин в этнотематике; 
• Выполнение на заказ услуг по этно боди-арту
